import { Component } from '@angular/core';
import { AuthService } from './auth/auth.service';
import { ManagePeriodicTokenRefresh } from "./auth/manage-periodic-token-refresh.service";
let AppComponent = class AppComponent {
    constructor(authService, managePeriodicTokenRefresh) {
        this.authService = authService;
        this.managePeriodicTokenRefresh = managePeriodicTokenRefresh;
        this.title = 'frontend-v02';
    }
    ngOnInit() {
        console.log('%c AppComponent ', 'background: red; color: #fff; padding: 0 10px;');
        this.managePeriodicTokenRefresh.initPeriodicRefresh();
        // this.authService.initAuthListener();
        // this.authService.authStateChange.subscribe(this.authService.authState);
    }
};
